import React, { useState, useEffect, Fragment} from "react"
import axios from 'axios'

const Matches = () => {
    const[matches, setMatches] = useState([])

    const API_URL = "http://localhost:3000/api/v1/matches.json"

    useEffect(() =>{
        //getter from API
        //updater from API 
        axios
        .get(API_URL)
        .then(resp => {
            setMatches(resp.data.data)
        })
        .catch(resp => console.log(resp))
    }, [matches.length])

    const list = matches.map( item => {
        return (<li key={item.attributes.name}>{item.attributes.name}</li>)
    })


    return (
    <Fragment>
        <div className="header">
            <h1>MatchRate</h1>
            <div className="subheader">Real people's opinions on Matches</div>
        </div>
        <div>This is the Matches#Index view of the app.</div>
        <ul>{list}</ul>
    </Fragment>
    )
}
export default Matches
